message:
Não estão em transe. Vejo diferente. Esta experiência repete a Alemanha nazista e a Itália fascista. É que nós que estamos vivos e adultos hoje não testemunhamos aquelas. 

Eles têm um propósito muito claro: defender seus privilégios. Tudo o que fazem é para evitar que 
1.Lula assuma; 
2.Se não der, que não possa governar; 
3.Se governar, que fracasse estrondosamente. 
Qualquer mínimo sucesso do governo Lula significará menos privilégios para esta classe do bolsonarismo mais duro. Por isso odeiam inclusão social. Mas disfarçam isso no comunismo inexistente e na farsa de comer cachorros
